import React, { Component } from 'react'

const API = "http://localhost:5000/questions/showAll"

class Landing extends Component {
  constructor(props) {
    super(props);
    this.state = {
        hits: JSON.stringify([]),
    };
}


componentDidMount(){
  fetch(API)
  .then(response => response.json())
  .then(data => this.setState({hits:data.hits}))
}
  render() {
    const { hits } = this.state;
    const num = 0;
    return (
      <ul>
        <li>{hits[num].id}</li>
      </ul>
    );
  }
}

export default Landing;
